import "../src/scss/styles.scss";
import { AnimatePresence } from "framer-motion";

export default function MyApp({ Component, pageProps, router }) {
  return (
    <AnimatePresence onExitComplete>
      <Component {...pageProps} key={router.route} />
    </AnimatePresence>
  );
}
